import rws_app_logo from '../assets/rws_logo.png';

function LandingPage({ user, setUser }) {
  const handleLogout = async () => {
    await fetch("http://localhost:5000/logout", { credentials: "include" });
    setUser(null);
  };

  return (
    <div className="h-screen w-screen flex flex-col bg-[#f6f8fb]">
      {/* Header */}
      <header className="flex items-center justify-between px-6 py-4 border-b bg-white shadow-sm">
        <div className="flex items-center gap-4">
          <img src={rws_app_logo} className="w-12" alt="logo" />
          <input type="text" placeholder="Search notes..." className="px-4 py-2 border rounded-lg w-72"/>
        </div>
        <div className="flex items-center gap-3">
          <span className="font-semibold text-[#4E8DC4]">{user.email}</span>
          <button onClick={handleLogout} className="text-sm underline text-[#1f2937]">Contul meu ▼</button>
        </div>
      </header>

      {/* 3 coloane */}
      <div className="flex flex-1 overflow-hidden">
        {/* Left */}
        <div className="w-1/4 border-r p-4 overflow-auto">
          <h3 className="font-bold mb-3 text-[#4E8DC4]">Materii</h3>
          <ul><li>Matematică</li><li>Fizică</li><li>Chimie</li></ul>
          <h3 className="font-bold mb-3 text-[#4E8DC4]">Etichete</h3>
          <ul><li>Important</li><li>De făcut</li></ul>
          <h3 className="font-bold mb-3 text-[#4E8DC4]">Grupuri</h3>
          <ul><li>Echipa A</li><li>Echipa B</li></ul>
        </div>

        {/* Middle */}
        <div className="w-1/3 border-r p-4 overflow-auto">
          <h3 className="font-bold mb-3 text-[#4E8DC4]">Notițe</h3>
          <ul><li>Notiță 1</li><li>Notiță 2</li></ul>
        </div>

        {/* Right */}
        <div className="flex-1 p-4 overflow-auto">
          <h3 className="font-bold mb-3 text-[#4E8DC4]">Detalii Notiță</h3>
          <p>Selectează o notiță pentru detalii.</p>
        </div>
      </div>
    </div>
  );
}

export default LandingPage;
